eval("module.exports = \"<template>\\r\\n  <require from=\\\"resources/nav-bar.html\\\"></require>\\r\\n  <div class=\\\"ui container page-host\\\">\\r\\n    <nav-bar router.bind=\\\"router\\\" auth.bind=\\\"authService\\\"></nav-bar>\\r\\n    <div id=\\\"consent-term\\\" class=\\\"justified-text collapse multi-collapse show\\\">\\r\\n      <h1 style=\\\"text-align: center;\\\">Termo de Consentimento Livre e Esclarecido</h1>\\r\\n      <h3 style=\\\"text-align: center;\\\">Estudo: Desenvolvimento de um sistema de recomendao baseado na teoria das inteligncias mltiplas para o ensino de lgica de programao</h3>\\r\\n      <p>Pesquisadora responsvel: Deborah Godoy Martins Corra</p>\\r\\n      <p>Instituio/Departamento: Universidade Federal de So Paulo  ICT - SJC</p>\\r\\n      <p>Telefone para contato: (12) 3924-9538</p>\\r\\n      <p>Local da coleta de dados: online</p>\\r\\n      <p>Prezado(a) Aluno(a) do Bacharelado em Cincia e Tecnologia (BCT) do Instituto de Cincia e Tecnologia da UNIFESP.</p>\\r\\n      <p>Voc est sendo convidado(a) a responder este questionrio de forma totalmente voluntria. Antes de concordar em participar desta pesquisa e responder ao questionrio,  muito importante que voc compreenda as informaes e instrues contidas neste documento. Os pesquisadores devero responder todas as suas dvidas antes que voc se decidir a participar. Voc tem o direito de desistir de participar da pesquisa a qualquer momento, sem nenhuma penalidade e sem perder os benefcios aos quais tenha direito. </p>\\r\\n      <p><b>Objetivo do estudo</b>: Investigar os estilos de aprendizagem e as diferentes habilidades e talentos dos estudantes que cursaram a disciplina Lgica da Programao.</p>\\r\\n      <p><b>Procedimentos</b>: Sua participao nesta pesquisa consistir no preenchimento deste questionrio, respondendo perguntas que abordam questes relativas ao seu estilo de aprendizagem.</p>\\r\\n      <p><b>Benefcios</b>: Esta pesquisa propiciar o aprimoramento do ensino aprendizagem da disciplina Lgica de Programao a partir do conhecimento dos estilos de aprendizagem dos alunos do Bacharelado em Cincia e Tecnologia. Caso tenha interesse, os resultados sero enviados posteriormente ao seu e-mail.</p>\\r\\n      <p><b>Riscos</b>: O preenchimento deste questionrio poder causar algum desconforto ou constrangimento ao participante.</p>\\r\\n      <p><b>Sigilo</b>: As informaes fornecidas por voc tero privacidade garantida pelos pesquisadores responsveis. Os dados coletados tero finalidade cientfica e acadmica, sero tabulados eletronicamente, de modo a assegurar a confidencialidade das respostas.</p>\\r\\n      <p>O tempo previsto para resposta  de aproximadamente 10 minutos e todas as questes so de preenchimento obrigatrio, mas voc pode desistir de participar a qualquer momento.</p>\\r\\n      <p>Ao responder o questionrio, voc manifesta concordncia com o presente Termo de Consentimento Livre e Esclarecido. Caso tenha alguma dvida, envie um e-mail para: deborah.correa@unifesp.br</p>\\r\\n      <p>Se voc tiver alguma considerao ou dvida sobre a tica da pesquisa, entre em contato com o Comit de tica em Pesquisa (CEP) da Unifesp  Rua Prof. Francisco de Castro, n 55, CEP: 04020-050., tel: (011)-5571-1062; (011)-5539- 7162. E-mail: cep@unifesp.edu.br</p>\\r\\n      <p>Agradeo antecipadamente!</p>\\r\\n      <div class=\\\"mb-3\\\">\\r\\n        <a class=\\\"btn btn-info\\\" href=\\\"#\\\" role=\\\"button\\\" data-toggle=\\\"collapse\\\" data-target=\\\".multi-collapse\\\" aria-expanded=\\\"false\\\" aria-controls=\\\"consent-term survey\\\">Ocultar e responder ao questionrio</a>\\r\\n      </div>\\r\\n    </div>\\r\\n    <div id=\\\"survey\\\" class=\\\"collapse multi-collapse mt-3\\\">\\r\\n      <h1>Questionrio de ${description}</h1>\\r\\n      <form id=\\\"answerForm\\\" role=\\\"form\\\" submit.delegate=\\\"submit($event.target)\\\" class=\\\"needs-validation\\\" novalidate>\\r\\n        <div repeat.for=\\\"question of questions\\\" class=\\\"rounded-lg answer pl-3 py-2 mb-2\\\">\\r\\n          <p>${question.position} - ${question.text}</p>\\r\\n          <label repeat.for=\\\"answer of sortAnswers(question.answers)\\\">\\r\\n            <input required type=\\\"radio\\\"\\r\\n            onchange=\\\"this.parentNode.parentNode.classList.remove('not-answered');\\\"\\r\\n            oninvalid=\\\"this.parentNode.parentNode.classList.add('not-answered');\\\"\\r\\n            name=\\\"q${question.id}\\\"\\r\\n            model.bind=\\\"{'question': question.id, 'answer': answer.id}\\\"\\r\\n            checked.bind=\\\"answers[question.id-1]\\\">\\r\\n            ${answer.text}\\r\\n          </label>\\r\\n        </div>\\r\\n        <div class=\\\"form-buttons mb-3\\\">\\r\\n          <button type=\\\"submit\\\" class=\\\"btn btn-dark\\\">Enviar</button>\\r\\n          <button type=\\\"button\\\" class=\\\"btn btn-secondary\\\" click.delegate=\\\"toHome()\\\">Voltar</button>\\r\\n        </div>\\r\\n      </form>\\r\\n    </div>\\r\\n  </div>\\r\\n</template>\\r\\n\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///viewmodels/student/answer/answer.html\n");

