eval("module.exports = \"<template>\\r\\n  <div class=\\\"modal fade\\\" id=\\\"audioGeneralInfoModal\\\" tabindex=\\\"-1\\\" role=\\\"dialog\\\" aria-hidden=\\\"true\\\">\\r\\n    <div class=\\\"modal-dialog modal-dialog-centered\\\" role=\\\"document\\\">\\r\\n      <div class=\\\"modal-content\\\">\\r\\n        <div class=\\\"modal-body\\\">\\r\\n          <div repeat.for=\\\"i of numberOfMainStudyOptionsToShow\\\">\\r\\n            <p class=\\\"mb-0\\\">${i+1} - Recomendaes para a inteligncia <b>${scores[i].description}</b></p>\\r\\n            <iframe id=\\\"audio-iframe-${i}\\\" width=\\\"100%\\\" height=\\\"166\\\" scrolling=\\\"no\\\" frameborder=\\\"no\\\" allow=\\\"autoplay\\\" src=\\\"about:blank\\\" data-mediaid.bind=\\\"scores[i].code\\\"></iframe>\\r\\n          </div>\\r\\n        </div>\\r\\n      </div>\\r\\n    </div>\\r\\n  </div>\\r\\n  <div class=\\\"modal fade\\\" id=\\\"videoGeneralInfoModal\\\" tabindex=\\\"-1\\\" role=\\\"dialog\\\" aria-hidden=\\\"true\\\">\\r\\n    <div class=\\\"modal-dialog modal-dialog-centered\\\" role=\\\"document\\\">\\r\\n      <div class=\\\"modal-content\\\">\\r\\n        <div class=\\\"modal-body\\\">\\r\\n          <div repeat.for=\\\"i of numberOfMainStudyOptionsToShow\\\" style=\\\"width:100%;display:block;\\\">\\r\\n            <p class=\\\"mb-0\\\">${i+1} - Recomendaes para a inteligncia <b>${scores[i].description}</b></p>\\r\\n            <iframe width=\\\"100%\\\" height=\\\"200\\\" src.bind=\\\"eMH.getExternalVideoLink(scores[i].code)\\\" frameborder=\\\"0\\\" allow=\\\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\\\" allowfullscreen></iframe>\\r\\n          </div>\\r\\n        </div>\\r\\n      </div>\\r\\n    </div>\\r\\n  </div>\\r\\n  <div class=\\\"modal fade\\\" id=\\\"infographicModal\\\" tabindex=\\\"-1\\\" role=\\\"dialog\\\" aria-hidden=\\\"true\\\">\\r\\n    <div class=\\\"modal-dialog modal-xl modal-dialog-scrollable modal-dialog-centered\\\" role=\\\"document\\\">\\r\\n      <div class=\\\"modal-content\\\">\\r\\n        <div class=\\\"modal-body\\\">\\r\\n          <img src.bind=\\\"getImageSrc('infographic.jpg')\\\" alt=\\\"Infogrfico\\\" style='width:100%;'>\\r\\n        </div>\\r\\n      </div>\\r\\n    </div>\\r\\n  </div>\\r\\n  <div class=\\\"modal fade\\\" id=\\\"generalInfoModal\\\" tabindex=\\\"-1\\\" role=\\\"dialog\\\" aria-hidden=\\\"true\\\">\\r\\n    <div class=\\\"modal-dialog modal-xl modal-dialog-scrollable modal-dialog-centered\\\" role=\\\"document\\\">\\r\\n      <div class=\\\"modal-content\\\">\\r\\n        <div class=\\\"modal-body\\\">\\r\\n          <div>\\r\\n            <h4>Inteligncia Verbo-Lingustica</h4>\\r\\n            <p>Pessoas com inteligncia lingustica amam palavras, gostam de ler e escrever. Apreciam as complexidades da estrutura da frase, estrutura da palavra, significado e som. So hbeis em se comunicar atravs da palavra escrita e procuram aprimorar suas habilidades. Caractersticas:</p>\\r\\n            <ul>\\r\\n              <li><b>Descrio</b>: Capacidade de processar rapidamente mensagens lingusticas, de ordenar palavras e de dar sentido lcido s mensagens.</li>\\r\\n              <li><b>Relao com demais inteligncias</b>: Relaciona-se com todas as demais e, particularmente, com a lgico-matemtica e a cinestsica-corporal.</li>\\r\\n              <li><b>Habilidades</b>: Descrever, narrar, observar, comparar, relatar, avaliar, concluir, sintetizar, compreender, explicar, memorizar.</li>\\r\\n              <li><b>Estmulos no Ensino Superior</b>: Anlises de casos especficos da rea de ensino. Uso da interdisciplinaridade na interpretao de fatos. Jogos operatrios e diferentes modalidades de Brainstorming.</li>\\r\\n            </ul>\\r\\n          </div>\\r\\n          <div>\\r\\n            <h4>Inteligncia Lgico-Matemtica</h4>\\r\\n            <p>Pessoas com inteligncia lgica processam informaes atravs da lgica e da razo. Buscam exatido e preciso em seu aprendizado e trabalho, e apreciam modelos matemticos, medies, abstraes e clculos complexos. Tm facilidade para investigao cientfico e mtodos quantitativos que dependem da capacidade do pesquisador de observar chegar a uma concluso. Caractersticas:</p>\\r\\n            <ul>\\r\\n              <li><b>Descrio: </b>Facilidade para o clculo e percepo da geometria espacial. Prazer especfico em resolver problemas com palavras cruzadas, charadas ou lgica, como tangram, jogos de gamo e xadrez.</li>\\r\\n              <li><b>Relao com demais inteligncias: </b>Relaciona-se com a inteligncia verbo-lingustica, visual-espacial, cinestsico-corporal e principalmente a rtmico-musical</li>\\r\\n              <li><b>Habilidades: </b>Enumerar, seriar, deduzir, medir, comparar, concluir, provar.</li>\\r\\n              <li><b>Estmulos no Ensino Superior: </b>Raciocinar logicamente e empregar esse raciocnio em relaes espaciais e operaes numricas. Estmulo a interpretao e a criatividade (interpretao grfica e numrica). Estudo da lgica.</li>\\r\\n            </ul>\\r\\n          </div>\\r\\n          <div>\\r\\n            <h4>Inteligncia Visual-Espacial</h4>\\r\\n            <p>Pessoas com inteligncia visual / espacial tm senso de direo, distncia e medio. Aprendem bem atravs de recursos visuais, como grficos, diagramas, imagens telas coloridas. Apreciam artes visuais, como desenho, pintura e fotografia. Caractersticas:</p>\\r\\n            <ul>\\r\\n              <li><b>Descrio: </b>Capacidade de perceber formas e objetos mesmo quando apresentados em ngulos no usuais com preciso, de efetuar transformaes sobre as percepes, de imaginar movimento ou deslocamento interno entre as partes de uma configurao, de recriar aspectos da experincia visual e de perceber as direes no espao concreto e abstrato.</li>\\r\\n              <li><b>Relao com demais inteligncias: </b>Com todas as demais, principalmente com as inteligncias verbo-lingustica, a rtmico-musical e a cinestsico-corporal.</li>\\r\\n              <li><b>Habilidades: </b>Localizar no espao, localizar no tempo, comparar, observar, deduzir, relatar, combinar, transferir.</li>\\r\\n              <li><b>Estmulos no Ensino Superior: </b>Uso da espacialidade como instrumento para explorar a criatividade e a flexibilidade. Atividades do tipo brainstorming. Jogos operatrios (cochicho, painel integrado, jogos de palavras). Estudos de caso como meio de explorao da espacialidade. Explorao de habilidades operatrias em atividades.</li>\\r\\n            </ul>\\r\\n          </div>\\r\\n          <div>\\r\\n            <h4>Inteligncia Rtmica-Musical</h4>\\r\\n            <p>Pessoas com inteligncia musical reconhecem sons e tons com facilidade, apreciam msica e ritmo. Podem facilmente aprender msicas e melodias e so especialmente dotadas para compor, cantar ou tocar um instrumento. Podem memorizar conceitos com  acilidade e aprendem bem atravs de palestras, por serem altamente auditivos. Caractersticas:</p>\\r\\n            <ul>\\r\\n              <li><b>Descrio: </b>Facilidade para identificar sons diferentes, perceber nuanas em sua intensidade e direo. Reconhece sons naturais e, na msica percebe a distino entre tom, melodia, ritmo, timbre e frequncia. Isola sons em agrupamentos musicais.</li>\\r\\n              <li><b>Relao com demais inteligncias: </b>Principalmente com a inteligncia lgico-matemtica e cinestsico-corporal.</li>\\r\\n              <li><b>Habilidades: </b>Observar, identificar, relatar, reproduzir, conceituar, combinar.</li>\\r\\n              <li><b>Estmulos no Ensino Superior: </b>Utilizao da linguagem musical como instrumento de comunicao interpessoal e capacidade de expresso. Estimulao da anlise e da capacidade de crtica para textos e para temas musicais. Estimulao da capacidade de classificao e seleo usando referncias musicais.</li>\\r\\n            </ul>\\r\\n          </div>\\r\\n          <div>\\r\\n            <h4>Inteligncia Cinestsica-Corporal</h4>\\r\\n            <p>Pessoas com inteligncia corporal-cinestsica aprendem atravs do movimento e da experimentao. Gostam de esportes, dana e atividades que exigem esforo fsico ou criatividade. Apreciam construir coisas e descobrir como funcionam. Eles  gostam de usar as mos, so muito ativos e apresentam excelentes habilidades motoras e coordenao. Caractersticas:</p>\\r\\n            <ul>\\r\\n              <li><b>Descrio: </b>Capacidade de trabalhar habilmente com objetos, tanto os que envolvem a motricidade dos dedos quanto os que exploram o uso integral do corpo.</li>\\r\\n              <li><b>Relao com demais inteligncias: </b>Principalmente com as inteligncias verbo-lingustica e visual-espacial</li>\\r\\n              <li><b>Habilidades: </b>Comparar, medir, relatar, transferir, demostrar, interagir, sintetizar, interpretar, classificar.</li>\\r\\n              <li><b>Estmulos no Ensino Superior: </b>Desmitificao do uso da expresso corporal e incorporao da linguagem cinestsica como ferramenta para o desenvolvimento de diferentes habilidades. Atividades culturais do tipo Brainstorming e estudos de caso. A linguagem gestual como recurso de ampliao de vocabulrio globalizado.</li>\\r\\n            </ul>\\r\\n          </div>\\r\\n          <div>\\r\\n            <h4>Inteligncia Naturalista</h4>\\r\\n            <p>Pessoas com inteligncia naturalista tm sensibilidade pela natureza e habilidade para cultivar plantas, vegetais e frutas. Eles tm uma afinidade com os animais e so bons em trein-los e entend-los.</p>\\r\\n            <p>Naturalistas podem facilmente distinguir padres na natureza. Eles esto cientes e intrigados pelos fenmenos climticos. Eles so bons em descobrir as maravilhas da natureza. Os naturalistas adoram andar, escalar, acampar e caminhar. Eles gostam do ar livre. Pessoas com inteligncia naturalista so inspiradas e rejuvenescidas pela natureza. Caractersticas:</p>\\r\\n            <ul>\\r\\n              <li><b>Descrio: </b>Atrao pelo mundo natural e sensibilidade em relao a ele, capacidade de identificao da linguagem natural a capacidade de xtase diante da paisagem humanizada, ou no.</li>\\r\\n              <li><b>Relao com demais inteligncias: </b>Interagem e relacionam-se com todas as demais, especificamente com as inteligncias verbo-lingustica, rtmico-musical e visual-espacial.</li>\\r\\n              <li><b>Habilidades: </b>Relatar, demonstrar, selecionar, levantar hiptese, classificar, revisar.</li>\\r\\n              <li><b>Estmulos no Ensino Superior: </b>Estabelecimento de vnculos entre diferentes linguagens e entre as carreiras administrativas matemticas jurdicas sociais e naturalistas. Grupos (voluntrios) de defesa ambiental e restaurao do patrimnio natural. Clubes de excurses e caminhadas.</li>\\r\\n            </ul>\\r\\n          </div>\\r\\n          <div>\\r\\n            <h4>Inteligncia Inter e Intrapessoal</h4>\\r\\n            <h5>Inteligncia interpessoal</h5>\\r\\n            <p>Pessoas com inteligncia interpessoal prosperam com interao social. So adeptos da leitura, e trabalham bem com os outros e tm muitos amigos. Eles so inclusivos, colaborativos e aprendem atravs de interao, dilogo e discusses. So entusiasmados e animados e procurados para conselhos, ajuda e conforto.</p>\\r\\n            <h5>Inteligncia intrapessoal</h5>\\r\\n            <p>Pessoas com inteligncia intrapessoal so introspectivas e hbeis em olhar para dentro e descobrir seus prprios sentimentos, motivaes e objetivos. So pessoas intuitivas e geralmente introvertidas. Aprendem de forma independente e atravs da reflexo. Caractersticas:</p>\\r\\n            <ul>\\r\\n              <li><b>Descrio: </b>Capacidade de perceber e compreender outras pessoas, descobrir as foras que as motivam e sentir grande empatia pelo outro indistinto. Intrapessoal  capacidade de autoestima, automotivao, de formao de um modelo coerente e verdico de si mesmo e do uso desse modelo para operacionalizar a construo da felicidade pessoal e social.</li>\\r\\n              <li><b>Relao com demais inteligncias: </b>Interagem e relacionam-se com todas as demais, particularmente com a verbo-lingustica, a naturalista e a cinestsico-corporal.</li>\\r\\n              <li><b>Habilidades: </b>Interagir, perceber, relacionar-se com empatia, apresentar autoestima e autoconhecimento, ser tico.</li>\\r\\n              <li><b>Estmulos no Ensino Superior: </b>Definio de misses para diferentes cursos, que enfatizem a tolerncia, o posicionamento critico, responsvel e construtivo do homem. Estudos de tica aplicados as disciplinas acadmicas. Enfoque da importncia da pluralidade e sua aceitao como meio da paz social.</li>\\r\\n            </ul>\\r\\n          </div>\\r\\n        </div>\\r\\n      </div>\\r\\n    </div>\\r\\n  </div>\\r\\n    <h4>Resultado do estudo de Inteligncias Mltiplas</h4>\\r\\n    <div class=\\\"justified-text\\\">\\r\\n      <p>Os resultados no \\\"medem inteligncias\\\", mas refletem o que voc pensa sobre si mesmo, epodero ajudar os docentes nas estratgias pedaggicas mais apropriadas  melhoria do processo de ensino e aprendizagem.</p>\\r\\n    </div>\\r\\n    <div class=\\\"card\\\">\\r\\n      <div class=\\\"card-header\\\" id=\\\"headingOne\\\" style=\\\"padding: 0;\\\">\\r\\n        <h2 class=\\\"mb-0\\\">\\r\\n          <button class=\\\"btn btn-link\\\" type=\\\"button\\\" data-toggle=\\\"collapse\\\" data-target=\\\"#collapseOne\\\" aria-expanded=\\\"true\\\" aria-controls=\\\"collapseOne\\\">\\r\\n            Recomendaes e material de apoio\\r\\n          </button>\\r\\n        </h2>\\r\\n      </div>\\r\\n      <div id=\\\"collapseOne\\\" class=\\\"collapse\\\" aria-labelledby=\\\"headingOne\\\">\\r\\n        <div class=\\\"card-body justified-text pb-0\\\">\\r\\n          <p>Gardner (1986) desenvolveu a teoria das Inteligncias Mltiplas e sugere que somos excelentes com diferentes tipos de inteligncia, que usadas simultaneamente se complementam e permitem o desenvolvimento de habilidades para resolver problemas.</p>\\r\\n          <p>Como cada pessoa apresenta um conjunto nico de caractersticas, conhecer as suas preferncias pode favorecer seu autoconhecimento e criar um ambiente mais propcio  aprendizagem. Seus resultados seguem abaixo.</p>\\r\\n          <p>Suas trs principais inteligncias so: <b>${mainStudyOptionsAsString}</b></p>\\r\\n          <p>Para saber mais sobre suas principais inteligncias voc pode escolher um ou mais dos seguintes recursos disponveis:</p>\\r\\n          <ul>\\r\\n            <li>Infogrfico - Como eu aprendo?\\r\\n              <a href=\\\"\\\" data-toggle=\\\"modal\\\" data-target=\\\"#infographicModal\\\">\\r\\n                <span class=\\\"oi oi-document\\\" title=\\\"Documento\\\" aria-hidden=\\\"true\\\"></span>\\r\\n              </a>\\r\\n            </li>\\r\\n            <li>Caractersticas gerais das inteligncias mltiplas\\r\\n              <a href=\\\"\\\" data-toggle=\\\"modal\\\" data-target=\\\"#generalInfoModal\\\">\\r\\n                <span class=\\\"oi oi-document\\\" title=\\\"Documento\\\" aria-hidden=\\\"true\\\"></span>\\r\\n              </a>\\r\\n              <a href=\\\"\\\" data-toggle=\\\"modal\\\" data-target=\\\"#audioGeneralInfoModal\\\">\\r\\n                <span class=\\\"oi oi-audio\\\" title=\\\"udio\\\" aria-hidden=\\\"true\\\"></span>\\r\\n              </a>\\r\\n              <a href=\\\"\\\" data-toggle=\\\"modal\\\" data-target=\\\"#videoGeneralInfoModal\\\">\\r\\n                <span class=\\\"oi oi-video\\\" title=\\\"Vdeo\\\" aria-hidden=\\\"true\\\"></span>\\r\\n              </a>\\r\\n            </li>\\r\\n            <li>Canal do programeict no YouTube\\r\\n              <a href=\\\"https://www.youtube.com/channel/UCWRtolDjRNWNzO-bkG2cEcA\\\" target=\\\"_blank\\\">\\r\\n                <span class=\\\"oi oi-video\\\" title=\\\"Vdeo\\\" aria-hidden=\\\"true\\\"></span>\\r\\n              </a>\\r\\n            </li>\\r\\n          </ul>\\r\\n          <compose view=\\\"./students-extra-resources.html\\\" model.bind=\\\"result\\\"></compose>\\r\\n        </div>\\r\\n      </div>\\r\\n    </div>\\r\\n</template>\\r\\n\";//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///viewmodels/student/result/IM.html\n");

